import React from 'react'
import './style.css'

function Navbar (props){
    return (
        <div id ='navbar'>
            <img className="header" src={"./CertifiedAtmsLogo.png"}Certified Atms />
            {console.log(props)}
            <button className="tabs" onClick={() => props.changeComponent('Home')}>Home |</button>
            <span className="tabs" onClick={() => props.changeComponent('Email')}>Email |</span>
            <span className="tabs" onClick={() => props.changeComponent("Machine")}>Machines |</span>
        </div>
    )
}



export default Navbar;
